import logo from "./logo.svg";
import "./App.css";
import FormImport from "./view/FormImport";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  BrowserRouter,
  Routes,
} from "react-router-dom";

function App() {
  return (
    <>
      <div className="App">
        <img src={logo} className="App-logo" alt="logo" />
      </div>

      <FormImport />

      <Routes>
        <Switch></Switch>
      </Routes>
    </>
  );
}

export default App;
